import React from 'react'

function SearchBar() {
  return (
    <div className='d-flex justify-content-start ms-5 p-5 align-items-center'>
        <div className='col-md-6'>
            <div className="form">
                <input type="text" className="form-control form-input" placeholder='Search' style={{color:"white",backgro}}/>
            </div>
        </div>

    </div>
  )
}

export default SearchBar
